import React from "react";

const Carrito = ({ carrito }) => {
    return (
      <div>
        <h2>Carrito de Compras</h2>
        {carrito.map(producto => (
          <CarritoItem
            key={producto.pr_id}
            imagenCa={producto.imagen}
            descripcionCa={producto.pr_descripcion}
            precioCa={producto.pr_precio}
          />
        ))}
      </div>
    );
  }

export default Carrito;
